import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Dashboard = () => {
  const navigate = useNavigate();
  const [apps, setApps] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const { first_name, user_id } = useSelector((state) => state.auth);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");
  };

  const fetchAvailableApps = async () => {
    try {
      // Fetch all active apps
      const appsResponse = await axios.get('/api/apps/');
      
      // Fetch user's completed tasks
      const tasksResponse = await axios.get('/api/tasks/');
      
      // Filter out apps already downloaded by the user
      const completedAppIds = tasksResponse.data.map(task => task.app);
      const availableApps = appsResponse.data.filter(
        app => !completedAppIds.includes(app.id)
      );

      setApps(availableApps);
      setLoading(false);
    } catch (err) {
      setError("Failed to fetch apps");
      setLoading(false);
    }
  };

  const claimAppPoints = async (appId) => {
    try {
      await axios.post('/api/tasks/submit/', { app: appId });
      // Refresh the app list after claiming points
      fetchAvailableApps();
    } catch (err) {
      setError("Failed to claim points");
    }
  };

  useEffect(() => {
    fetchAvailableApps();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="min-h-screen bg-gray-900 text-gray-200">
      <nav className="bg-black p-4 shadow-lg border-b border-gray-800">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-gray-200 font-bold text-2xl">
            Android App Download Portal
          </h1>
          <div className="flex items-center space-x-4 ml-auto">
            <h1 className="text-gray-300 text-lg">Welcome, {first_name}</h1>
            <button
              className="bg-gray-800 px-4 py-2 rounded text-gray-200 hover:bg-gray-700 transition duration-300"
              onClick={handleLogout}
            >
              Logout
            </button>
          </div>
        </div>
      </nav>

      <div className="container mx-auto mt-6 px-6">
        <h2 className="text-2xl font-bold mb-4">Available Apps to Download</h2>
        
        {apps.length === 0 ? (
          <div className="text-gray-500 text-center py-8">
            No new apps available to download
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {apps.map((app) => (
              <div 
                key={app.id} 
                className="bg-gray-800 rounded-lg overflow-hidden shadow-lg transform transition hover:scale-105"
              >
                {app.app_icon && (
                  <img 
                    src={app.app_icon} 
                    alt={app.name} 
                    className="w-full h-48 object-cover"
                  />
                )}
                <div className="p-4">
                  <h3 className="text-xl font-semibold mb-2">{app.name}</h3>
                  <p className="text-gray-400 mb-2">{app.description}</p>
                  <div className="flex justify-between items-center">
                    <span className="text-green-500 font-bold">
                      {app.points_value} Points
                    </span>
                    <div className="space-x-2">
                      {app.playstore_link && (
                        <a 
                          href={app.playstore_link} 
                          target="_blank" 
                          rel="noopener noreferrer"
                          className="bg-blue-600 text-white px-3 py-1 rounded hover:bg-blue-700 transition"
                        >
                          Play Store
                        </a>
                      )}
                      <button
                        onClick={() => claimAppPoints(app.id)}
                        className="bg-green-600 text-white px-3 py-1 rounded hover:bg-green-700 transition"
                      >
                        Claim Points
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
